    "Email": "\u0d08\u0d2e\u0d46\u0d2f\u0d3f\u0d32\u0d4d\u200d", 
    "Emails successfully sent. The following users are no longer enrolled in the course:": "\u0d08\u0d2e\u0d46\u0d2f\u0d3f\u0d32\u0d4d\u200d \u0d35\u0d3f\u0d1c\u0d2f\u0d15\u0d30\u0d2e\u0d3e\u0d2f\u0d3f \u0d05\u0d2f\u0d1a\u0d4d\u0d1a\u0d3f\u0d30\u0d3f\u0d15\u0d4d\u0d15\u0d41\u0d28\u0d4d\u0d28\u0d41. \u0d24\u0d3e\u0d34\u0d46\u0d15\u0d3e\u0d23\u0d41\u0d28\u0d4d\u0d28 \u0d09\u0d2a\u0d2f\u0d47\u0d3e\u0d15\u0d4d\u0d24\u0d3e\u0d15\u0d4d\u0d15\u0d33\u0d4d\u200d \u0d07\u0d28\u0d3f \u0d2e\u0d41\u0d24\u0d32\u0d4d\u200d \u0d15\u0d4b\u0d34\u0d4d\u0d38\u0d3f\u0d32\u0d46 \u0d05\u0d02\u0d17\u0d19\u0d4d\u0d19\u0d33\u0d4d\u200d \u0d05\u0d32\u0d4d\u0d32", 
    "Embed": "\u0d09\u0d31\u0d2a\u0d4d\u0d2a\u0d3f\u0d15\u0d4d\u0d15\u0d41\u0d15", 
    "Emoticons": "\u0d35\u0d3f\u0d15\u0d3e\u0d30 \u0d1a\u0d3f\u0d39\u0d4d\u0d28\u0d2d\u0d3e\u0d37\u0d15\u0d33\u0d4d\u200d", 
    "Encoding": "\u0d0e\u0d28\u0d4d\u200d\u0d15\u0d4b\u0d21\u0d3f\u0d19\u0d4d\u0d19\u0d4d", 
    "End": "\u0d05\u0d35\u0d38\u0d3e\u0d28\u0d3f\u0d2a\u0d4d\u0d2a\u0d3f\u0d15\u0d4d\u0d15\u0d41\u0d15", 
    "Enter username or email": "\u0d09\u0d2a\u0d2f\u0d47\u0d3e\u0d15\u0d4d\u0d24 \u0d28\u0d3e\u0d2e\u0d2e\u0d4b \u0d08\u0d2e\u0d46\u0d2f\u0d3f\u0d32\u0d4b \u0d2a\u0d4d\u0d30\u0d35\u0d47\u0d36\u0d3f\u0d2a\u0d4d\u0d2a\u0d3f\u0d15\u0d4d\u0d15\u0d41\u0d15", 
    "Error": "\u0d24\u0d15\u0d30\u0d3e\u0d30\u0d4d\u200d", 
    "Error adding/removing users as beta testers.": "\u0d09\u0d2a\u0d2f\u0d47\u0d3e\u0d15\u0d4d\u0d24\u0d3e\u0d15\u0d4d\u0d15\u0d33\u0d46 \u0d2c\u0d40\u0d31\u0d4d\u0d31\u0d3e \u0d2a\u0d30\u0d3f\u0d36\u0d47\u0d3e\u0d27\u0d15\u0d30\u0d3e\u0d2f\u0d3f \u0d1a\u0d47\u0d30\u0d4d\u200d\u0d15\u0d4d\u0d15\u0d41\u0d28\u0d4d\u0d28\u0d24\u0d3f\u0d32\u0d4d\u200d/\u0d28\u0d40\u0d15\u0d4d\u0d15\u0d02 \u0d1a\u0d46\u0d2f\u0d4d\u0d2f\u0d41\u0d28\u0d4d\u0d28\u0d24\u0d3f\u0d32\u0d4d\u200d \u0d24\u0d15\u0d30\u0d3e\u0d30\u0d4d\u200d \u0d28\u0d47\u0d30\u0d3f\u0d1f\u0d4d\u0d1f\u0d41.", 
    "Error changing user's permissions.": "\u0d09\u0d2a\u0d2f\u0d47\u0d3e\u0d15\u0d4d\u0d24\u0d3e\u0d35\u0d3f\u0d28\u0d4d\u0d31\u0d46 \u0d05\u0d28\u0d41\u0d2e\u0d24\u0d3f\u0d15\u0d33\u0d4d\u200d \u0d2e\u0d3e\u0d31\u0d4d\u0d31\u0d41\u0d28\u0d4d\u0d28\u0d24\u0d3f\u0d32\u0d4d\u200d \u0d24\u0d15\u0d30\u0d3e\u0d30\u0d4d\u200d \u0d28\u0d47\u0d30\u0d3f\u0d1f\u0d4d\u0d1f\u0d41.", 
    "Error deleting student '<%= student_id %>'s state on problem '<%= problem_id %>'. Make sure that the problem and student identifiers are complete and correct.": "'<%= student_id %>' \u0d0e\u0d28\u0d4d\u0d28 \u0d35\u0d3f\u0d26\u0d4d\u0d2f\u0d3e\u0d30\u0d4d\u200d\u0d25\u0d3f\u0d2f\u0d41\u0d1f\u0d46 <%= problem_id %>' \u0d2a\u0d4d\u0d30\u0d36\u0d4d\u0d28\u0d24\u0d4d\u0d24\u0d3f\u0d28\u0d4d\u0d31\u0d46 \u0d05\u0d35\u0d38\u0d4d\u0d25 \u0d28\u0d40\u0d15\u0d4d\u0d15\u0d02 \u0d1a\u0d46\u0d2f\u0d4d\u0d2f\u0d41\u0d28\u0d4d\u0d28\u0d24\u0d3f\u0d32\u0d4d\u200d \u0d24\u0d15\u0d30\u0d3e\u0d30\u0d4d\u200d \u0d28\u0d47\u0d30\u0d3f\u0d1f\u0d4d\u0d1f\u0d41. \u0d2a\u0d4d\u0d30\u0d36\u0d4d\u0d28\u0d24\u0d4d\u0d24\u0d3f\u0d28\u0d4d\u0d31\u0d47\u0d2f\u0d41\u0d02 \u0d35\u0d3f\u0d26\u0d4d\u0d2f\u0d3e\u0d30\u0d4d\u200d\u0d25\u0d3f\u0d2f\u0d41\u0d1f\u0d47\u0d2f\u0d41\u0d02 \u0d24\u0d3f\u0d30\u0d3f\u0d1a\u0d4d\u0d1a\u0d31\u0d3f\u0d2f\u0d32\u0d4d\u200d \u0d30\u0d47\u0d16\u0d15\u0d33\u0d4d\u200d \u0d2a\u0d42\u0d30\u0d4d\u200d\u0d23\u0d4d\u0d23\u0d2e\u0d46\u0d28\u0d4d\u0d28\u0d41\u0d02 \u0d36\u0d30\u0d3f\u0d2f\u0d46\u0d28\u0d4d\u0d28\u0d41\u0d02 \u0d09\u0d31\u0d2a\u0d4d\u0d2a\u0d41\u0d35\u0d30\u0d41\u0d24\u0d4d\u0d24\u0d41\u0d15.", 
    "Error enrolling/unenrolling users.": "\u0d09\u0d2a\u0d2f\u0d47\u0d3e\u0d15\u0d4d\u0d24\u0d3e\u0d15\u0d4d\u0d15\u0d33\u0d46 \u0d05\u0d02\u0d17\u0d2e\u0d3e\u0d2f\u0d3f \u0d1a\u0d47\u0d30\u0d4d\u200d\u0d15\u0d4d\u0d15\u0d41\u0d28\u0d4d\u0d28\u0d24\u0d3f\u0d32\u0d41\u0d02/\u0d28\u0d40\u0d15\u0d4d\u0d15\u0d02 \u0d1a\u0d46\u0d2f\u0d4d\u0d2f\u0d41\u0d28\u0d4d\u0d28\u0d24\u0d3f\u0d32\u0d41\u0d02 \u0d24\u0d15\u0d30\u0d3e\u0d30\u0d4d\u200d \u0d38\u0d02\u0d2d\u0d35\u0d3f\u0d1a\u0d4d\u0d1a\u0d41.", 
    "Error generating grades. Please try again.": "\u0d28\u0d3f\u0d32\u0d35\u0d3e\u0d30\u0d19\u0d4d\u0d19\u0d33\u0d4d\u200d \u0d09\u0d32\u0d4d\u200d\u0d2a\u0d3e\u0d26\u0d3f\u0d2a\u0d4d\u0d2a\u0d3f\u0d15\u0d4d\u0d15\u0d41\u0d28\u0d4d\u0d28\u0d24\u0d3f\u0d32\u0d4d\u200d \u0d2a\u0d3f\u0d34\u0d35\u0d4d \u0d28\u0d47\u0d30\u0d3f\u0d1f\u0d4d\u0d1f\u0d41. \u0d26\u0d2f\u0d35\u0d3e\u0d2f\u0d3f \u0d35\u0d40\u0d23\u0d4d\u0d1f\u0d41\u0d02 \u0d36\u0d4d\u0d30\u0d2e\u0d3f\u0d15\u0d4d\u0d15\u0d41\u0d15.", 
    "Error getting student list.": "\u0d15\u0d41\u0d1f\u0d4d\u0d1f\u0d3f\u0d15\u0d33\u0d41\u0d1f\u0d46 \u0d2a\u0d1f\u0d4d\u0d1f\u0d3f\u0d15 \u0d32\u0d2d\u0d3f\u0d15\u0d4d\u0d15\u0d41\u0d28\u0d4d\u0d28\u0d24\u0d3f\u0d32\u0d4d\u200d \u0d2a\u0d3f\u0d34\u0d35\u0d4d \u0d38\u0d02\u0d2d\u0d35\u0d3f\u0d1a\u0d4d\u0d1a\u0d41.", 
    "Error getting student progress url for '<%= student_id %>'. Make sure that the student identifier is spelled correctly.": "'<%= student_id %>' \u0d2f\u0d41\u0d1f\u0d46 \u0d2a\u0d41\u0d30\u0d4b\u0d17\u0d24\u0d3f \u0d2f\u0d42\u0d06\u0d30\u0d4d\u200d\u0d0e\u0d32\u0d4d\u200d \u0d32\u0d2d\u0d3f\u0d15\u0d4d\u0d15\u0d41\u0d28\u0d4d\u0d28\u0d24\u0d3f\u0d32\u0d4d\u200d \u0d24\u0d15\u0d30\u0d3e\u0d30\u0d4d\u200d \u0d38\u0d02\u0d2d\u0d35\u0d3f\u0d1a\u0d4d\u0d1a\u0d41. \u0d26\u0d2f\u0d35\u0d3e\u0d2f\u0d3f \u0d35\u0d3f\u0d26\u0d4d\u0d2f\u0d3e\u0d30\u0d4d\u200d\u0d25\u0d3f\u0d2f\u0d41\u0d1f\u0d46 \u0d24\u0d3f\u0d30\u0d3f\u0d1a\u0d4d\u0d1a\u0d31\u0d3f\u0d2f\u0d32\u0d4d\u200d \u0d30\u0d47\u0d16 \u0d28\u0d32\u0d4d\u0d15\u0d3f\u0d2f\u0d24\u0d4d \u0d15\u0d43\u0d24\u0d4d\u0d2f\u0d2e\u0d3e\u0d23\u0d4d \u0d0e\u0d28\u0d4d\u0d28\u0d4d \u0d09\u0d31\u0d2a\u0d4d\u0d2a\u0d41\u0d35\u0d30\u0d41\u0d24\u0d4d\u0d24\u0d41\u0d15.", 
    "Error getting task history for problem '<%= problem_id %>' and student '<%= student_id %>'. Make sure that the problem and student identifiers are complete and correct.": "<%= problem_id %>' \u0d2a\u0d4d\u0d30\u0d36\u0d4d\u0d28\u0d24\u0d4d\u0d24\u0d3f\u0d28\u0d4d\u0d31\u0d46\u0d2f\u0d41\u0d02 '<%= student_id %>' \u0d35\u0d3f\u0d26\u0d4d\u0d2f\u0d3e\u0d30\u0d4d\u200d\u0d25\u0d3f\u0d2f\u0d41\u0d1f\u0d47\u0d2f\u0d41\u0d02 \u0d15\u0d30\u0d4d\u200d\u0d24\u0d4d\u0d24\u0d35\u0d4d\u0d2f \u0d1a\u0d30\u0d3f\u0d24\u0d4d\u0d30\u0d02 \u0d32\u0d2d\u0d3f\u0d15\u0d4d\u0d15\u0d41\u0d28\u0d4d\u0d28\u0d24\u0d3f\u0d32\u0d4d\u200d \u0d24\u0d15\u0d30\u0d3e\u0d30\u0d4d\u200d \u0d38\u0d02\u0d2d\u0d35\u0d3f\u0d1a\u0d4d\u0d1a\u0d41. \u0d2a\u0d4d\u0d30\u0d36\u0d4d\u0d28\u0d24\u0d4d\u0d24\u0d3f\u0d28\u0d4d\u0d31\u0d47\u0d2f\u0d41\u0d02 \u0d35\u0d3f\u0d26\u0d4d\u0d2f\u0d3e\u0d30\u0d4d\u200d\u0d25\u0d3f\u0d2f\u0d41\u0d1f\u0d47\u0d2f\u0d41\u0d02 \u0d24\u0d3f\u0d30\u0d3f\u0d1a\u0d4d\u0d1a\u0d31\u0d3f\u0d2f\u0d32\u0d4d\u200d \u0d30\u0d47\u0d16\u0d15\u0d33\u0d4d\u200d \u0d2a\u0d42\u0d30\u0d4d\u200d\u0d23\u0d4d\u0d23\u0d2e\u0d46\u0d28\u0d4d\u0d28\u0d41\u0d02 \u0d36\u0d30\u0d3f\u0d2f\u0d46\u0d28\u0d4d\u0d28\u0d41\u0d02 \u0d09\u0d31\u0d2a\u0d4d\u0d2a\u0d41\u0d35\u0d30\u0d41\u0d24\u0d4d\u0d24\u0d41\u0d15.", 
