    "No tasks currently running.": "\u0d15\u0d30\u0d4d\u200d\u0d35\u0d4d\u0d2f\u0d19\u0d4d\u0d19\u0d33\u0d4d\u200d \u0d12\u0d28\u0d4d\u0d28\u0d41\u0d02 \u0d24\u0d28\u0d4d\u0d28\u0d46 \u0d07\u0d2a\u0d4d\u0d2a\u0d4b\u0d33\u0d4d\u200d \u0d2a\u0d4d\u0d30\u0d35\u0d30\u0d4d\u200d\u0d24\u0d4d\u0d24\u0d3f\u0d15\u0d4d\u0d15\u0d41\u0d28\u0d4d\u0d28\u0d3f\u0d32\u0d4d\u0d32.", 
    "No threads matched your query.": "\u0d24\u0d3e\u0d19\u0d4d\u0d15\u0d33\u0d41\u0d1f\u0d46 \u0d1a\u0d4b\u0d26\u0d4d\u0d2f\u0d35\u0d41\u0d2e\u0d3e\u0d2f\u0d3f \u0d38\u0d3e\u0d2e\u0d4d\u0d2f\u0d2e\u0d41\u0d33\u0d4d\u0d33 \u0d15\u0d25\u0d3e\u0d24\u0d28\u0d4d\u0d24\u0d41\u0d15\u0d4d\u0d15\u0d33\u0d4d\u200d \u0d32\u0d2d\u0d3f\u0d1a\u0d4d\u0d1a\u0d3f\u0d32\u0d4d\u0d32.", 
