    "Paste is now in plain text mode. Contents will now be pasted as plain text until you toggle this option off.": "\u0d2a\u0d24\u0d3f\u0d2a\u0d4d\u0d2a\u0d3f\u0d15\u0d4d\u0d15\u0d32\u0d4d\u200d \u0d2a\u0d4d\u0d30\u0d15\u0d4d\u0d30\u0d3f\u0d2f \u0d07\u0d2a\u0d4d\u0d2a\u0d4b\u0d33\u0d4d\u200d \u0d32\u0d33\u0d3f\u0d24\u0d35\u0d1a\u0d28 \u0d30\u0d40\u0d24\u0d3f\u0d2f\u0d3f\u0d32\u0d3e\u0d23\u0d4d. \u0d08 \u0d10\u0d1a\u0d4d\u0d1b\u0d3f\u0d15\u0d02 \u0d2e\u0d3e\u0d31\u0d4d\u0d31\u0d42\u0d28\u0d4d\u0d28\u0d24\u0d41\u0d35\u0d30\u0d46 \u0d09\u0d33\u0d4d\u0d33\u0d1f\u0d15\u0d4d\u0d15\u0d19\u0d4d\u0d19\u0d33\u0d4d\u200d \u0d32\u0d33\u0d3f\u0d24\u0d35\u0d1a\u0d28 \u0d30\u0d40\u0d24\u0d3f\u0d2f\u0d3f\u0d32\u0d3e\u0d2f\u0d3f\u0d30\u0d3f\u0d15\u0d4d\u0d15\u0d41\u0d02 \u0d2a\u0d24\u0d3f\u0d2a\u0d4d\u0d2a\u0d3f\u0d15\u0d4d\u0d15\u0d41\u0d28\u0d4d\u0d28\u0d24\u0d4d.", 
    "Paste row after": "\u0d36\u0d47\u0d37\u0d02 \u0d35\u0d30\u0d3f \u0d2a\u0d24\u0d3f\u0d2a\u0d4d\u0d2a\u0d3f\u0d15\u0d4d\u0d15\u0d41\u0d15", 
