    "Play": "\u0d2a\u0d4d\u0d32\u0d47", 
    "Please address the errors on this page first, and then save your progress.": "\u0d06\u0d26\u0d4d\u0d2f\u0d02 \u0d08 \u0d24\u0d3e\u0d33\u0d3f\u0d32\u0d46 \u0d2a\u0d4d\u0d30\u0d36\u0d4d\u0d28\u0d19\u0d4d\u0d19\u0d33\u0d46 \u0d05\u0d2d\u0d3f\u0d2e\u0d41\u0d16\u0d40\u0d15\u0d30\u0d3f\u0d15\u0d4d\u0d15\u0d41, \u0d2a\u0d3f\u0d28\u0d4d\u0d28\u0d46 \u0d38\u0d42\u0d15\u0d4d\u0d37\u0d3f\u0d15\u0d4d\u0d15\u0d42", 
    "Please do not use any spaces in this field.": "\u0d08 \u0d2a\u0d46\u0d1f\u0d4d\u0d1f\u0d3f\u0d2f\u0d3f\u0d32\u0d4d\u200d \u0d35\u0d3f\u0d1f\u0d35\u0d41\u0d15\u0d7e  \u0d09\u0d2a\u0d2f\u0d4b\u0d17\u0d3f\u0d15\u0d4d\u0d15\u0d30\u0d41\u0d24\u0d4d.", 
    "Please do not use any spaces or special characters in this field.": "\u0d08 \u0d2a\u0d46\u0d1f\u0d4d\u0d1f\u0d3f\u0d2f\u0d3f\u0d32\u0d4d\u200d \u0d35\u0d3f\u0d1f\u0d35\u0d41\u0d15\u0d33\u0d4b \u0d2a\u0d4d\u0d30\u0d24\u0d4d\u0d2f\u0d47\u0d15 \u0d05\u0d15\u0d4d\u0d37\u0d30\u0d19\u0d4d\u0d19\u0d33\u0d4b \u0d09\u0d2a\u0d2f\u0d4b\u0d17\u0d3f\u0d15\u0d4d\u0d15\u0d30\u0d41\u0d24\u0d4d.", 
    "Please enter a problem location.": "\u0d15\u0d4b\u0d34\u0d4d\u0d38\u0d3f\u0d32\u0d46 \u0d2a\u0d4d\u0d30\u0d36\u0d4d\u0d28\u0d2e\u0d41\u0d33\u0d4d\u0d33 \u0d38\u0d4d\u0d25\u0d32\u0d02 \u0d1a\u0d47\u0d30\u0d4d\u200d\u0d15\u0d4d\u0d15\u0d41\u0d15.", 
    "Please enter a student email address or username.": "\u0d26\u0d2f\u0d35\u0d3e\u0d2f\u0d3f \u0d12\u0d30\u0d41 \u0d35\u0d3f\u0d26\u0d4d\u0d2f\u0d3e\u0d30\u0d4d\u200d\u0d25\u0d3f\u0d2f\u0d41\u0d1f\u0d46 \u0d08\u0d2e\u0d46\u0d2f\u0d3f\u0d32\u0d4b \u0d05\u0d32\u0d4d\u0d32\u0d46\u0d19\u0d4d\u0d15\u0d3f\u0d32\u0d4d\u200d \u0d09\u0d2a\u0d2f\u0d47\u0d3e\u0d15\u0d4d\u0d24 \u0d28\u0d3e\u0d2e\u0d2e\u0d4b \u0d2a\u0d4d\u0d30\u0d35\u0d47\u0d36\u0d3f\u0d2a\u0d4d\u0d2a\u0d3f\u0d15\u0d4d\u0d15\u0d41\u0d15.", 
    "Please enter a username or email.": "\u0d26\u0d2f\u0d35\u0d3e\u0d2f\u0d3f \u0d12\u0d30\u0d41 \u0d09\u0d2a\u0d2f\u0d47\u0d3e\u0d15\u0d4d\u0d24 \u0d28\u0d3e\u0d2e\u0d2e\u0d4b \u0d08\u0d2e\u0d46\u0d2f\u0d3f\u0d32\u0d4b \u0d2a\u0d4d\u0d30\u0d35\u0d47\u0d36\u0d3f\u0d2a\u0d4d\u0d2a\u0d3f\u0d15\u0d4d\u0d15\u0d41\u0d15", 
    "Please enter an integer between 0 and 100.": "\u0d2a\u0d42\u0d1c\u0d4d\u0d2f\u0d24\u0d4d\u0d24\u0d3f\u0d28\u0d41\u0d02 \u0d28\u0d42\u0d31\u0d3f\u0d28\u0d41\u0d2e\u0d3f\u0d1f\u0d2f\u0d3f\u0d32\u0d46 \u0d12\u0d30\u0d41 \u0d2a\u0d42\u0d30\u0d4d\u200d\u0d23 \u0d38\u0d02\u0d16\u0d4d\u0d2f \u0d28\u0d32\u0d4d\u200d\u0d15\u0d42", 
