    "Successfully sent enrollment emails to the following users. They will be enrolled once they register:": "\u0d24\u0d3e\u0d34\u0d46\u0d15\u0d3e\u0d23\u0d41\u0d28\u0d4d\u0d28 \u0d09\u0d2a\u0d2f\u0d47\u0d3e\u0d15\u0d4d\u0d24\u0d3e\u0d15\u0d4d\u0d15\u0d33\u0d4d\u200d\u0d15\u0d4d\u0d15\u0d4d  \u0d05\u0d02\u0d17\u0d24\u0d4d\u0d35 \u0d08\u0d2e\u0d46\u0d2f\u0d3f\u0d32\u0d4d\u200d \u0d05\u0d2f\u0d1a\u0d4d\u0d1a\u0d3f\u0d30\u0d3f\u0d15\u0d4d\u0d15\u0d41\u0d28\u0d4d\u0d28\u0d41. \u0d30\u0d1c\u0d3f\u0d38\u0d4d\u0d31\u0d4d\u0d31\u0d30\u0d4d\u200d \u0d1a\u0d46\u0d2f\u0d4d\u200c\u0d24\u0d41 \u0d15\u0d34\u0d3f\u0d1e\u0d4d\u0d1e\u0d3e\u0d32\u0d4d\u200d \u0d08 \u0d09\u0d2a\u0d2f\u0d47\u0d3e\u0d15\u0d4d\u0d24\u0d3e\u0d15\u0d4d\u0d15\u0d33\u0d4d\u200d\u0d15\u0d4d\u0d15\u0d4d \u0d05\u0d02\u0d17\u0d24\u0d4d\u0d35\u0d02 \u0d28\u0d32\u0d4d\u0d15\u0d41\u0d28\u0d4d\u0d28\u0d24\u0d3e\u0d23\u0d4d:", 
