    "The URL you entered seems to be an external link. Do you want to add the required http:// prefix?": "\u0d24\u0d3e\u0d19\u0d4d\u0d19\u0d33\u0d4d\u200d \u0d2a\u0d4d\u0d30\u0d35\u0d47\u0d36\u0d3f\u0d2a\u0d4d\u0d2a\u0d3f\u0d1a\u0d4d\u0d1a URL \u0d2a\u0d41\u0d31\u0d24\u0d4d\u0d24\u0d41\u0d33\u0d4d\u0d33 \u0d12\u0d30\u0d41 \u0d32\u0d3f\u0d19\u0d4d\u0d15\u0d41\u0d4d \u0d06\u0d23\u0d46\u0d28\u0d4d\u0d28\u0d41 \u0d24\u0d4a\u0d28\u0d4d\u0d28\u0d41\u0d28\u0d4d\u0d28\u0d41. \u0d06\u0d35\u0d36\u0d4d\u0d2f\u0d2e\u0d3e\u0d2f http:// \u0d0e\u0d28\u0d4d\u0d28 \u0d09\u0d2a\u0d38\u0d30\u0d4d\u200d\u0d17\u0d4d\u0d17\u0d02 \u0d1a\u0d47\u0d30\u0d4d\u200d\u0d15\u0d4d\u0d15\u0d47\u0d23\u0d4d\u0d1f\u0d24\u0d41\u0d23\u0d4d\u0d1f\u0d4b?", 
    "The course must have an assigned start date.": "\u0d08 \u0d15\u0d4b\u0d34\u0d4d\u0d38\u0d3f\u0d28\u0d41 \u0d12\u0d30\u0d41 \u0d24\u0d41\u0d1f\u0d15\u0d4d\u0d15 \u0d26\u0d3f\u0d28\u0d02 \u0d09\u0d23\u0d4d\u0d1f\u0d3e\u0d2f\u0d3f\u0d30\u0d3f\u0d15\u0d4d\u0d15\u0d23\u0d02", 
    "The enrollment end date cannot be after the course end date.": "\u0d2a\u0d47\u0d30\u0d41 \u0d1a\u0d47\u0d30\u0d4d\u200d\u0d15\u0d4d\u0d15\u0d32\u0d4d\u200d \u0d12\u0d1f\u0d41\u0d15\u0d4d\u0d15 \u0d26\u0d3f\u0d28\u0d02 \u0d15\u0d4b\u0d34\u0d4d\u0d38\u0d3f\u0d28\u0d4d\u0d31\u0d46 \u0d12\u0d1f\u0d41\u0d15\u0d4d\u0d15 \u0d26\u0d3f\u0d28\u0d24\u0d4d\u0d24\u0d3f\u0d28\u0d41 \u0d36\u0d47\u0d37\u0d2e\u0d3e\u0d15\u0d30\u0d41\u0d24\u0d4d", 
