    "The following email addresses and/or usernames are invalid:": "\u0d24\u0d3e\u0d34\u0d46 \u0d15\u0d4a\u0d1f\u0d41\u0d24\u0d4d\u0d24\u0d3f\u0d30\u0d3f\u0d15\u0d4d\u0d15\u0d41\u0d28\u0d4d\u0d28 \u0d08\u0d2e\u0d46\u0d2f\u0d3f\u0d32\u0d4b \u0d05\u0d32\u0d4d\u0d32\u0d46\u0d19\u0d4d\u0d15\u0d3f\u0d32\u0d4d\u200d \u0d09\u0d2a\u0d2f\u0d47\u0d3e\u0d15\u0d4d\u0d24 \u0d28\u0d3e\u0d2e\u0d02 \u0d2a\u0d4d\u0d30\u0d3e\u0d2c\u0d32\u0d4d\u0d2f\u0d24\u0d4d\u0d24\u0d3f\u0d32\u0d4d\u200d \u0d07\u0d32\u0d4d\u0d32:", 
